const Product = (props) => {
    return (
        <>
            <div className='product-listing'>
                <div className=''>
                <h2>Products</h2>
                </div>
                <div className='products'>
                <h2>Electronics Items</h2>
                <ul className='product-list'>
                    <li>falana</li>
                </ul>
                </div>
            </div>
        </>
    )
};

export default Product;
